// ==UserScript==
// @name         Petals
// @namespace    https://github.com/LenAnderson/
// @downloadURL  https://github.com/LenAnderson/Petals/raw/master/petals.user.js
// @version      0.1
// @author       LenAnderson
// @description  Petals floating down your screen...
// @match        *://*/*
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    let petalImgs = [
        'data:image/png;base64,',
        'data:image/png;base64,',
        'data:image/png;base64,',
        'data:image/png;base64,',
        'data:image/png;base64,',
        'data:image/png;base64,',
        'data:image/png;base64,'
    ];

    let max = 10;
    let size = 1;
    let velocity = {
        min: 1,
        max: 2
    }
    let turbulence = {
        min: 1,
        max: 10
    };
    let turbSpeed = {
        min: 200,
        max: 500
    };
    let rotation = {
        min: 0.1,
        max: 0.5
    };
    let avoid = 100;

    let delay = 800;

    let petals = [];
    let cursor = {x:0,y:0};

    addEventListener('mousemove', evt => cursor = {x:evt.screenX, y:evt.screenY});

    let lastFrame = 0;

    function update() {
        petals = petals.filter(it=>it.onScreen);
        let now = new Date().getTime();
        if (now - lastFrame > delay && petals.length < max) {
            addPetal();
            lastFrame = now;
        }

        movePetals();

        requestAnimationFrame(update);
    }

    function addPetal() {
        petals.push(new Petal(petalImgs[Math.floor(Math.random() * petalImgs.length)]));
    }

    function movePetals() {
        petals.filter(it=>!it.loading).forEach(petal=>petal.update());
    }


    class Petal {
        constructor(img) {
            this.onScreen = true;
            this.loading = true;
            this.img = new Image();
            this.img.addEventListener('load', () => {
                document.body.appendChild(this.img);
                let rect = this.img.getBoundingClientRect();
                this.x = Math.random() * (innerWidth - rect.width);
                this.img.style.top = -rect.height + 'px';
                this.img.style.left = this.left + 'px';
                this.loading = false;
            });
            this.img.src = img;
            this.img.style.position = 'fixed';
            this.img.style.zIndex = 1000;
            this.velocity = Math.random() * (velocity.max - velocity.min) + velocity.min;
            this.rotVelocity = (Math.random() * (rotation.max - rotation.min) + rotation.min) * (Math.random()<0.5?-1:1);
            this.rotation = Math.random() * 360;
            this.img.style.transform = `rotate(${this.rotation}deg)`;
            this.turbulence = Math.random() * (turbulence.max - turbulence.min) + turbulence.min;
            this.turbSpeed = Math.random() * (turbSpeed.max - turbSpeed.min) + turbSpeed.min;
            this.start = new Date().getTime();
        }

        update() {
            let rect = this.img.getBoundingClientRect();
            let dist = Math.sqrt(Math.pow(cursor.x - (rect.right + rect.width / 2), 2) + Math.pow(cursor.y - rect.top + rect.height / 2));
            let size = Math.max(rect.height, rect.width);
            let aDist = avoid - (dist - size);
            if (aDist < 0 && false) {
            } else {
                this.img.style.top = Number(this.img.style.top.replace(/px$/,'')) + this.velocity + 'px';
                this.rotation += this.rotVelocity;
                this.img.style.transform = `rotate(${this.rotation}deg)`;
                this.img.style.left = this.x + Math.sin((new Date().getTime() - this.start) / this.turbSpeed) * this.turbulence + 'px';
            }

            if (rect.top > innerHeight) {
                this.img.remove();
                this.onScreen = false;
            }
        }
    }

    update();
})();
